import styled from "styled-components";
import Menu from "./components/Menu";
import Navbar from "./components/Navbar";
const Container = styled.div`
display:flex;
`;

const Main = styled.div`
flex:7;
`;
const Wrapper = styled.div`
`;

function App() {
  return (
    <Container className="App">
    <Menu/>
    <Main>
    <Navbar/>
    <Wrapper>
      <h1> Video Cards</h1>
    </Wrapper>

    </Main>
    </Container>
  );
}

export default App;
